import blogsData from "./blogsData";
function Card(props) {
  return (
    <div className=" box">
      <img src={props.imageURL} height="300px" width="290px" />
      <h6 className="blog-dates">{props.date}</h6>
      <h4 className="blog-headings">{props.bHeading}</h4>
      <button className="blog-btn">Read more</button>
    </div>
  );
}
function App() {
  return (
    <div className="blogBoxes">
      <Card
        imageURL={blogsData[0].imgURL}
        date={blogsData[0].dates}
        bHeading={blogsData[0].bHeading}
      />
      <Card
        imageURL={blogsData[1].imgURL}
        date={blogsData[1].dates}
        bHeading={blogsData[1].bHeading}
      />
      <Card
        imageURL={blogsData[2].imgURL}
        date={blogsData[2].dates}
        bHeading={blogsData[2].bHeading}
      />
    </div>
  );
}
export default App;
